function Home() {
  return (
    <div style={{padding: '20px', textAlign: 'center'}}>
      <h1>MediLab - Dental Clinic</h1>
      <p>Website is working!</p>
      <p>If you see this, React is working correctly.</p>
    </div>
  );
}

export default Home;
